column8:
バッグに持ち手をつけるためのアタッチメントです。<br>
迷彩柄で、同シリーズのファスナーや持ち手と組み合わせて<br>
統一感を持たせることができます。<br>
<br>
縫いつけ用のガイド穴が開いています。<br>
<br>
■サイズ約/H5.5×3cm(Dカン含む)<br>
■素材/合皮(ポリビニールクロライド)<br>
■1組2個入<br>
■金具/アンティークゴールド<br><br><img src="https://image.rakuten.co.jp/tukurutanosimi/cabinet/mail_ok.jpg" /><style type="text/css">
